import React from "react";
import "./FoodAndWine.css";
import { Tabs, Tab, Row, Col } from "react-bootstrap";
import { ImSpoonKnife } from "react-icons/im";
import { useState } from "react";
import BigCategories from "./FoodAndWine/BigCategories";
import DayType from "./FoodAndWine/DayType";
import SpecificFood from "./FoodAndWine/SpecificFood";
const FoodAndWine = () => {
  const [key, setKey] = useState("home");

  return (
    <div>
      <div className="title">
        <div class="container py-4">
          <header class="pb-3 mb-4 border-bottom">
            <a class="d-flex align-items-center text-dark text-decoration-none">
              <span class="fs-4">
                <ImSpoonKnife className="initial-icons" />
                &nbsp; Food & Wine
              </span>
            </a>
          </header>{" "}
          <Tabs
            activeKey={key}
            onSelect={(k) => setKey(k)}
            transition={false}
            className="mb-6"
          >
            <Tab eventKey="home" title="Big Categories">
              <div className="tab-body">
                <BigCategories />
              </div>
            </Tab>
            <Tab eventKey="profile" title="Day Type">
              <div className="tab-body">
                <DayType />
              </div>
            </Tab>
            <Tab eventKey="contact" title="Specific Foods">
              <div className="tab-body">
                <SpecificFood />
               
              </div>
            </Tab>
          </Tabs>
        </div>
      </div>
    </div>
  );
};

export default FoodAndWine;
